import marshal
import base64
import decompyle3
import sys

def dec2(code):
    code = base64.b85decode(code)
    code = base64.b64decode(code)
    code = base64.b32decode(code)
    code = base64.b16decode(code)
    
    if(len(sys.argv) == 2 and sys.argv[1] == "fallback"):
        print(code)  #went wrong, but since the code is a string, the code is visible
        return
    else:
        decompyle3.main.decompile(marshal.loads(code))
        return

